import React, { Component } from 'react';

class WalletForm extends Component {
  render() {
    return (
      <fieldset>
        <label htmlFor="description">
          Descição:
          <input
            data-testid="description-input"
            type="text"
            id="description"
            name="description"
          />
        </label>
        <button
          type="submit"
          data-testid="value-input"
        >
          Adicionar Despesa
        </button>
      </fieldset>
    );
  }
}

export default WalletForm;
